// Home.js

import React from 'react';
import { Link } from 'react-router-dom';

function Home({ isLoggedIn, onLogout }) {
  const handleLogout = () => {
    onLogout();
  };

  return (
    <div className="Home">
      <h1>메인 화면입니다.</h1>
      {isLoggedIn && (
        <nav className="Menu">
          <ul>
            <li>
              <Link to="/">홈</Link>
            </li>
            <li>
              <Link to="/about">소개</Link>
            </li>
            <li>
              <Link to="/contact">연락</Link>
            </li>
            <li>
              <button onClick={handleLogout}>로그아웃</button>
            </li>
          </ul>
        </nav>
      )}
    </div>
  );
}

export default Home;
